import Sidebar, { SidebarItem } from "./components/Sidebar";

import { LayoutDashboard, BarChart3, Package } from "lucide-react";

export default function App() {
  return (
    <main className="App">
      <Sidebar>
        <SidebarItem
          icon={<LayoutDashboard size={20} />}
          text="Dashboard"
          alert
        ></SidebarItem>
        <SidebarItem
          icon={<BarChart3 size={20} />}
          text={"Dashboard"}
        ></SidebarItem>
        <SidebarItem
          icon={<Package size={20} />}
          text={"Kriteria"}
        ></SidebarItem>
        <SidebarItem
          icon={<Package size={20} />}
          text={"Alternatif"}
        ></SidebarItem>
        <SidebarItem
          icon={<Package size={20} />}
          text={"Perhitungan AHP"}
        ></SidebarItem>
        <SidebarItem
          icon={<Package size={20} />}
          text={"Rekomendasi & WP"}
        ></SidebarItem>
      </Sidebar>
    </main>
  );
}
